void drawCuteImage() {
    int x = (tft.width());
    int y = (tft.height());
    tft.drawRGBBitmap(x, y, cute_img, 40, 40);
}

void handleNewMessages(int numNewMessages) {
	for (int i = 0; i < numNewMessages; i++) {
		String chat_id = bot.messages[i].chat_id;
		String text = bot.messages[i].text;
		if (text == "/hello") {
			bot.sendMessage(chat_id, "HELLO BRO  )", "");
			tft.fillScreen(ST77XX_BLACK);
			tft.setCursor(0, 0);
			tft.setTextColor(ST77XX_GREEN);
			tft.setTextSize(1);
		} else if (text == "/help") {
			bot.sendMessage(chat_id, "CAN I HELP YOU?", "");
			tft.fillScreen(ST77XX_BLACK);
			tft.setCursor(0, 0);
			tft.setTextColor(ST77XX_YELLOW);
			tft.setTextSize(1);
			tft.println("How can I help you?");
		} else if (text == "/start") {
			String msg = "";
			msg += "Cho mng bn n vi bot ca chng ti!\n";
			msg += "Cc lnh bn c th dng:\n";
			msg += "/hello - Cho hi\n";
			msg += "/help - Hng dn\n";
			msg += "/weather - Xem thi tit\n";
			msg += "/photo - Gi nh\n";
			msg += "/video - Gi video\n";
			msg += "/link - Lin kt\n";
			msg += "/news - Tin tc mi\n";
			bot.sendMessage(chat_id, msg, "");
			tft.fillScreen(ST77XX_BLACK);
			tft.setCursor(0, 0);
			tft.setTextColor(ST77XX_CYAN);
			tft.setTextSize(1);
			tft.println("Welcome to our bot!");
			tft.println("Commands:");
			tft.println("/hello");
			tft.println("/help");
			tft.println("/weather");
			tft.println("/photo");
			tft.println("/video");
			tft.println("/link");
			tft.println("/news");
		} else if (text.startsWith("/weather")) {
			String city = "H Ni";
			if (text.length() > 8) city = text.substring(9);
			String api_key = "4194bc8a9f0a6201907bb33ef2dfb5c2";
			String url = "http://api.openweathermap.org/data/2.5/weather?q=" + city + "&appid=" + api_key + "&units=metric&lang=vi";
			WiFiClient clientWeather;
			HTTPClient http;
			http.begin(clientWeather, url);
			int httpCode = http.GET();
			if (httpCode == 200) {
				String payload = http.getString();
				DynamicJsonDocument doc(256);
				deserializeJson(doc, payload);
				float temp = doc["main"]["temp"];
				String desc = doc["weather"][0]["description"].as<String>();
				int humidity = doc["main"]["humidity"];
				int pressure = doc["main"]["pressure"];
				float wind = doc["wind"]["speed"];
				String weatherMsg = "Weather in " + city + ": " + desc + "\n";
				weatherMsg += "Temperature: " + String(temp) + " C\n";
				weatherMsg += "Humidity: " + String(humidity) + " %\n";
				weatherMsg += "Pressure: " + String(pressure) + " hPa\n";
				weatherMsg += "Wind: " + String(wind) + " m/s";
				bot.sendMessage(chat_id, weatherMsg, "");
				tft.fillScreen(ST77XX_BLACK);
				tft.setCursor(0, 0);
				tft.setTextColor(ST77XX_WHITE);
				tft.setTextSize(1);
				tft.println("Weather in " + city);
				tft.println(desc);
				tft.print("Temp: "); tft.print(temp); tft.println("C");
				tft.print("Hum: "); tft.print(humidity); tft.println("%");
				tft.print("Pres: "); tft.print(pressure); tft.println("hPa");
				tft.print("Wind: "); tft.print(wind); tft.println("m/s");
			} else {
				bot.sendMessage(chat_id, "Khng tm thy thng tin thi tit cho thnh ph ny.", "");
				tft.fillScreen(ST77XX_BLACK);
				tft.setCursor(0, 0);
				tft.setTextColor(ST77XX_RED);
				tft.setTextSize(1);
				tft.println("Weather info not found!");
			}
			http.end();
		} else if (text == "/photo") {
			bot.sendPhoto(chat_id, "https://photos.app.goo.gl/4uF3DKZbW6mwV9L26", "nh mu");
			tft.fillScreen(ST77XX_BLACK);
			tft.setCursor(0, 0);
			tft.setTextColor(ST77XX_MAGENTA);
			tft.setTextSize(2);
			tft.println("Send sample photo!");
		} else if (text == "/video") {
			bot.sendMessage(chat_id, "Video mu: https://drive.google.com/uc?export=download&id=1I36b9RaXDIGiihdG0OWAb9YkH3_R5xaB", "");
			tft.fillScreen(ST77XX_BLACK);
			tft.setCursor(0, 0);
			tft.setTextColor(ST77XX_BLUE);
			tft.setTextSize(1);
			tft.println("Send sample video!");
		} else if (text == "/link") {
			bot.sendMessage(chat_id, "FB : https://www.facebook.com/tspromax", "");
			bot.sendMessage(chat_id, "Github : https://github.com/Tsprov1", "");
			bot.sendMessage(chat_id, "Zalo : https://zalo.me/0862067001", "");
			tft.fillScreen(ST77XX_BLACK);
			tft.setCursor(0, 0);
			tft.setTextColor(ST77XX_YELLOW);
			tft.setTextSize(1);
			tft.println("FB: tspromax");
			tft.println("Github: Tsprov1");
			tft.println("Zalo: 0862067001");
		} else if (text == "/news") {
			bot.sendMessage(chat_id, "News not supported!", "");
			tft.fillScreen(ST77XX_BLACK);
			tft.setCursor(0, 0);
			tft.setTextColor(ST77XX_WHITE);
			tft.setTextSize(1);
			tft.println("News not supported!");
		} else if (text == "/cute") {
			bot.sendMessage(chat_id, "Here is something cute!", "");
			tft.fillScreen(ST77XX_BLACK);
			drawCuteImage();
		} else {
			bot.sendMessage(chat_id, "Lnh khng hp l. G /help  xem hng dn.", "");
			tft.fillScreen(ST77XX_BLACK);
			tft.setCursor(0, 0);
			tft.setTextColor(ST77XX_RED);
			tft.setTextSize(1);
			tft.println("Invalid command!");
		}
	}
}

void setup() {
	tft.initR(INITR_BLACKTAB);
	tft.setRotation(1);
	tft.fillScreen(ST77XX_BLACK);
	tft.setTextColor(ST77XX_WHITE);
	tft.setTextSize(1);
	tft.setCursor(0, 0);
	tft.println("ESP32 Telegram Bot");
	Serial.begin(115200);
	WiFi.mode(WIFI_STA);
	WiFi.begin(ssid, password);
	Serial.print("ang kt ni WiFi...");
	while (WiFi.status() != WL_CONNECTED) {
		delay(500);
		Serial.print(".");
	}
	Serial.println("\nWiFi  kt ni!");
	client.setInsecure();
}

void loop() {
	int numNewMessages = bot.getUpdates(bot.last_message_received + 1);
	while (numNewMessages) {
		handleNewMessages(numNewMessages);
		numNewMessages = bot.getUpdates(bot.last_message_received + 1);
	}
}

